import { useEffect, useState } from "react";
import "./App.css";
import axios from "axios";
import { Col, Row, Card, Input, Button, Spin, Skeleton } from "antd";
import {
  HeartFilled,
  TeamOutlined,
  TagsOutlined,
  CommentOutlined,
} from "@ant-design/icons";

function App() {
  const [openChatList, setOpenChatList] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    async function fetchOpenChatList() {
      const res = await axios.get("http://localhost:5000/getLinks", {
        headers: { "Access-Control-Allow-Origin": "*" },
      });

      setOpenChatList(res.data.result.lists);
      setLoading(false);
    }

    fetchOpenChatList();

    return () => {};
  }, []);

  function renderOpenChatList() {
    console.log(openChatList);

    return openChatList.map((chat) => {
      return (
        <Col span={6} style={{ margin: "10px 0" }}>
          <Card
            title={chat.name}
            style={{
              backgroundColor: "#fefefa",
            }}
          >
            <p>
              <TeamOutlined /> {chat.headcount} / <HeartFilled /> {chat.like}
            </p>

            <a
              aria-label="Link to enter chat room"
              href={chat.openlink}
              target="_blank"
              rel="noreferrer"
            >
              <Button>
                <CommentOutlined /> 입장
              </Button>
            </a>
            <div>
              <small>최근 메세지: {chat.lastchat}</small>
            </div>

            <hr />
            <div>
              <TagsOutlined />{" "}
              {chat.tags.map((tag) => {
                return <span>{tag} </span>;
              })}
            </div>
          </Card>
        </Col>
      );
    });
  }

  const { Search } = Input;

  return (
    <>
      <div class="masonry-container">
        <div class="masonry-item">
          <a href="https://uk.pinterest.com/pin/436286282624249460/">
            <img src="https://s-media-cache-ak0.pinimg.com/736x/61/4f/1b/614f1b3a481f68b4d492f71c5fe3fc5f.jpg" />
          </a>
          <span>Img 1</span>
        </div>

        <div class="masonry-item">
          <a href="https://uk.pinterest.com/pin/481040803922110845/">
            <img src="https://s-media-cache-ak0.pinimg.com/736x/1d/6f/2d/1d6f2d4fff0f0d4e83456c28b0645bbd.jpg" />
          </a>
          <span>Img 2</span>
        </div>

        <div class="masonry-item">
          <a href="http://grrlathr.com/woodworkingstand/picture-frame-design-on-walls-plans-diy-free-download-plans-to-build-bunk-beds">
            <img src="http://i00.i.aliimg.com/wsphoto/v0/1913341970_3/New-Design-Photo-Frame-Wall-Decals-Memories-Photo-Frame-Vinyl-Wall-Stickers-Home-Decor-Witness-Every.jpg" />
          </a>
          <span>Img 3</span>
        </div>
        <div class="masonry-item">
          <a href="https://uk.pinterest.com/pin/436286282624249460/">
            <img src="https://s-media-cache-ak0.pinimg.com/736x/61/4f/1b/614f1b3a481f68b4d492f71c5fe3fc5f.jpg" />
          </a>
          <span>Img 4</span>
        </div>

        <div class="masonry-item">
          <a href="https://uk.pinterest.com/pin/481040803922110845/">
            <img src="https://s-media-cache-ak0.pinimg.com/736x/1d/6f/2d/1d6f2d4fff0f0d4e83456c28b0645bbd.jpg" />
          </a>
          <span>Img 5</span>
        </div>

        <div class="masonry-item">
          <a href="http://grrlathr.com/woodworkingstand/picture-frame-design-on-walls-plans-diy-free-download-plans-to-build-bunk-beds">
            <img src="http://i00.i.aliimg.com/wsphoto/v0/1913341970_3/New-Design-Photo-Frame-Wall-Decals-Memories-Photo-Frame-Vinyl-Wall-Stickers-Home-Decor-Witness-Every.jpg" />
